import React, { useState } from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import Home from './components/Home';
import LoginPage from './components/LoginPage';
import RegisterPage from './components/RegisterPage';
import AdminPanel from './components/AdminPanel';
import OpenComplaints from './components/OpenComplaints';
import SolvedComplaints from './components/SolvedComplaints';
import UserComplaints from './components/UserComplaints';
import CreateComplaint from './components/CreateComplaint';
import ComplaintDetail from './components/ComplaintDetail';
const App = () => {
  const [loggedIn, setLoggedIn] = useState(false);
  const [username, setUsername] = useState('');
  const [user_id, setUserId] = useState('');
  const [is_admin, setIs_Admin] = useState('');
  const [is_yetkili, setIs_Yetkili] = useState('');
  
  const handleLogin = (userData) => {
    setLoggedIn(true);
    setUsername(userData.username);
    setUserId(userData.user_id);
    setIs_Admin(userData.is_admin);
    setIs_Yetkili(userData.is_yetkili);

    console.log(userData.user_id,'asfasf',userData.username,userData.is_admin,is_yetkili);
  };

  return (
    <Router>
      <div>
        <nav>
          <ul>
            <li>
              <Link to="/">Ana Sayfa</Link>
            </li>
            <li>
              <Link to="/register">Kayıt Ol</Link>
            </li>
            <li>
              <Link to="/login">Giriş yap</Link>
            </li>
            <li>
              <Link to="/admin">Admin Paneli</Link>
            </li>
            <li>
              <Link to="/open-complaints">Açık Arızalar</Link>
            </li>
            <li>
              <Link to="/solved-complaints">Çözümlenmiş Arızalar</Link>
            </li>
            <li>
              <Link to="/user-complaints">Kullanıcı Arızaları</Link>
            </li>
            <li>
              <Link to="/create-complaint">Arıza Oluştur</Link>
            </li>
          
          
          </ul>
        </nav>

        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/register" element={<RegisterPage />} />
          <Route path="/login" element={<LoginPage handleLogin={handleLogin} />} />
          <Route path="/admin" element={<AdminPanel />} />
          <Route path="/open-complaints" element={<OpenComplaints is_admin={is_admin}/>} />
          <Route path="/solved-complaints" element={<SolvedComplaints is_admin={is_admin}/>} />
          <Route path="/user-complaints" element={<UserComplaints user_id={user_id} />} />
          <Route path="/create-complaint" element={<CreateComplaint loggedIn={loggedIn} user_id={user_id} />} />
          <Route path="/complaint/:complaint_id" element={<ComplaintDetail  is_yetkili={is_yetkili}  />} />
        </Routes>
      </div>
    </Router>
  );
};

export default App;
